import React from 'react'
import styled from 'styled-components'
import { Header } from '../main-pages/header'
import { Margin36 } from '../component/styledComponent'
import { TermBox } from './termBox'
import { LocationText, PrivacyText } from './text'
import { Footer } from '../main-pages/footer'

const Container = styled.div`
  width: 100%;
`
const BodyContainer = styled.div`
  margin: 0 auto;
  width: 1280px;
  height: 800px;
`

export const Privacy = () => {
  return (
    <Container>
      <Header />
      <Margin36 />
      <BodyContainer>
        {PrivacyText.map((privacy, index) => {
          return <TermBox title={privacy.title} contents={privacy.contents} />
        })}
      </BodyContainer>
      <Footer />
    </Container>
  )
}
